import '../../assets/css/header.css'

const Header = () => {

    return (
        <header>
            <center>
                <img src="https://marcas-logos.net/wp-content/uploads/2019/11/Nasa-Logo.png" alt="Logo Nasa" width="300px" />
            </center>
        </header>
    )
}
export default Header
